import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Search = createReactComponent("Search", ["svg", defaultAttributes, [["circle", {
  cx: "11",
  cy: "11",
  r: "8",
  key: "18pnwe"
}], ["line", {
  x1: "21",
  y1: "21",
  x2: "16.65",
  y2: "16.65",
  key: "u0ckfk"
}]]]);
export default Search;
